import { HomePage } from './pages/Home/home';
import { Signup } from './pages/About/signup';
import { Route, Routes } from 'react-router-dom';
function App() {
  return (
    <Routes>

        <Route path="/" element={<HomePage />} />
        <Route path="/about" element={<Signup />} />

      </Routes>
  );
}
export default App;
